import React, { useState } from "react";
import axios from "../utils/axiosInstance";

const PrivacyPolicyForm = () => {
  const [form, setForm] = useState({
    virksomhed_navn: "",
    email: "",
    lokation: "",
    branche: "",
    brugertyper: "",
    kontaktformular: false,
    nyhedsbrev: false,
    webshop: false,
    cookies: false,
  });

  const [generatedHtml, setGeneratedHtml] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm({
      ...form,
      [name]: type === "checkbox" ? checked : value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      const res = await axios.post("/gdpr/policy/generate", form);
      setGeneratedHtml(res.data.html);
    } catch (err) {
      alert("Fejl under generering af politik");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-3xl mx-auto p-6">
      <div className="card">
        <h2 className="text-xl font-semibold mb-4">Gener√©r privatlivspolitik</h2>
        <form onSubmit={handleSubmit} className="space-y-6">
          <input
            name="virksomhed_navn"
            type="text"
            required
            placeholder="Virksomhedsnavn"
            className="w-full p-3 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-400"
            value={form.virksomhed_navn}
            onChange={handleChange}
          />
          <input
            name="email"
            type="email"
            required
            placeholder="Kontakt-e-mail"
            className="w-full p-3 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-400"
            value={form.email}
            onChange={handleChange}
          />
          <input
            name="lokation"
            type="text"
            placeholder="Lokation (by, land)"
            className="w-full p-3 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-400"
            value={form.lokation}
            onChange={handleChange}
          />
          <input
            name="branche"
            type="text"
            placeholder="Branche"
            className="w-full p-3 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-400"
            value={form.branche}
            onChange={handleChange}
          />
          <input
            name="brugertyper"
            type="text"
            placeholder="Brugertyper (fx privatkunder)"
            className="w-full p-3 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-gray-400"
            value={form.brugertyper}
            onChange={handleChange}
          />

          <div className="grid grid-cols-1 sm:grid-cols-2 gap-x-6 gap-y-4 pt-2">
            <label className="flex items-center gap-2 text-gray-700">
              <input
                type="checkbox"
                name="kontaktformular"
                checked={form.kontaktformular}
                onChange={handleChange}
                className="h-4 w-4 text-blue-600 border-gray-300 rounded"
              />
              <span>Kontaktformular</span>
            </label>
            <label className="flex items-center gap-2 text-gray-700">
              <input
                type="checkbox"
                name="nyhedsbrev"
                checked={form.nyhedsbrev}
                onChange={handleChange}
                className="h-4 w-4 text-blue-600 border-gray-300 rounded"
              />
              <span>Nyhedsbrev</span>
            </label>
            <label className="flex items-center gap-2 text-gray-700">
              <input
                type="checkbox"
                name="webshop"
                checked={form.webshop}
                onChange={handleChange}
                className="h-4 w-4 text-blue-600 border-gray-300 rounded"
              />
              <span>Webshop</span>
            </label>
            <label className="flex items-center gap-2 text-gray-700">
              <input
                type="checkbox"
                name="cookies"
                checked={form.cookies}
                onChange={handleChange}
                className="h-4 w-4 text-blue-600 border-gray-300 rounded"
              />
              <span>3rd-party cookies</span>
            </label>
          </div>

          <button
            type="submit"
            disabled={loading}
            className="mt-4 bg-[#7e6e5c] hover:bg-[#5c4e42] text-white py-2 px-6 rounded-md transition"
          >
            {loading ? "Genererer..." : "Gener√©r politik"}
          </button>
        </form>
      </div>

      {generatedHtml && (
        <div className="card mt-8">
          <h3 className="text-lg font-medium mb-2">Din privatlivspolitik</h3>
          <div dangerouslySetInnerHTML={{ __html: generatedHtml }} />
        </div>
      )}
    </div>
  );
};

export default PrivacyPolicyForm;
